Sora no Iro Mizu no Iro EPISODES 01-02

[RAW - Japanese Audio, Censored / COMPLETE]


Asa &amp; Natsume are both in love with Hajime Saisho. Instead of fighting over him, they both promised to share him equally over summer vacation and then let him go. Will they be able to keep to the terms of their agreement?



